import NavLink from './nav-link';

const navItems = [
  {
    title: 'bit lore',
    path: '/'
  },
  {
    title: 'about',
    path: '/about'
  },
  {
    title: 'work',
    path: '/work'
  },
  {
    title: 'contact',
    path: '/contact'
  }
];

const Header = () => (
  <nav>

    <div>
      <Link href="/about">
        <a>about</a>
      </Link>
    </div>
    <div>
      <Link href="/work">
        <a>work</a>
      </Link>
    </div>
    <div>
      <Link href="/contact">
        <a>contact</a>
      </Link>
    </div>
    <style jsx>{`
      nav {
      	display: flex;
      	justify-content: space-between;
      	margin: 0 auto;
      	height: 2em;
      	line-height: 2em;
      }

      @media only screen and (max-width:600px) {
      	nav {
      		text-align: center;
      	}
      }
    `}</style>
  </nav>
);

export default Header;
